import React from 'react';
import './App.css';


class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      todoList: [],
      activeItem: {
        id: null,
      },
    }
    this.fetchTasks = this.fetchTasks.bind(this)
  };


  componentWillMount() {
    this.fetchTasks()
  }

  fetchTasks() {
    console.log('Fetching...')

    fetch('http://localhost:8000/api/task-list/')
      .then(response => response.json())
      .then(data =>
        this.setState({
          todoList: data
        })
      )
  }



  render() {
    var tasks = this.state.todoList
    return (
      <div className="container">

        <div id="task-container">

          <div id="list-wrapper">
            {tasks.map(function (task, chave) {
              return (
                <div key={chave} className="task-wrapper flex-wrapper">


                    <span>{task.title}</span>




                </div>
              )
            })}
          </div>
        </div>

      </div>
    )
  }
}



export default App;
